#include <fuzzer/FuzzedDataProvider.h>

#include <stddef.h>
#include <stdint.h>

#include "GlobalParams.h"
#include "PDFDoc.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);

  double hDPI = fdp.ConsumeFloatingPointInRange<double>(1.0, 1000.0);
  double vDPI = fdp.ConsumeFloatingPointInRange<double>(1.0, 1000.0);
  int rotate = fdp.ConsumeIntegralInRange<int>(0, 360);
  GBool useMediaBox = fdp.ConsumeBool();
  GBool crop = fdp.ConsumeBool();
  GBool printing = fdp.ConsumeBool();
  int sliceX = fdp.ConsumeIntegralInRange<int>(0, 1000);
  int sliceY = fdp.ConsumeIntegralInRange<int>(0, 1000);
  int sliceW = fdp.ConsumeIntegralInRange<int>(0, 1000);
  int sliceH = fdp.ConsumeIntegralInRange<int>(0, 1000);
  std::vector<char> buf = fdp.ConsumeRemainingBytes<char>();

  globalParams = new GlobalParams("/usr/local/etc/xpdfrc");
  globalParams->setupBaseFonts("/usr/share/ghostscript/9.25/Resource/cidfmap");

  Object obj;
  obj.initNull();
  MemStream *str = new MemStream(buf.data(), 0, buf.size(), &obj);
  PDFDoc *doc = new PDFDoc(str, NULL, NULL, NULL);

  if (doc->isOk()) {
    doc->displayPageSlice(NULL, 1, hDPI, vDPI, rotate, useMediaBox, crop, printing, sliceX, sliceY, sliceW, sliceH);
  }

  return 0;
}

#include <fuzzer/FuzzedDataProvider.h>

#include <stddef.h>
#include <stdint.h>
#include <string.h>
#include <vector>

#include "/src/xpdf-4.05/xpdf/Object.h"
#include "/src/xpdf-4.05/xpdf/Stream.h"
#include "/src/xpdf-4.05/xpdf/Dict.h"
#include "/src/xpdf-4.05/xpdf/GBool.h"
#include "/src/xpdf-4.05/xpdf/MemStream.h"
#include "/src/xpdf-4.05/xpdf/PDFDoc.h"
#include "/src/xpdf-4.05/xpdf/OutputDev.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);
  int page = fdp.ConsumeIntegral<int>();
  double hDPI = fdp.ConsumeFloatingPoint<double>();
  double vDPI = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeIntegral<GBool>();
  GBool crop = fdp.ConsumeIntegral<GBool>();
  GBool printing = fdp.ConsumeIntegral<GBool>();
  int sliceX = fdp.ConsumeIntegral<int>();
  int sliceY = fdp.ConsumeIntegral<int>();
  int sliceW = fdp.ConsumeIntegral<int>();
  int sliceH = fdp.ConsumeIntegral<int>();
  std::vector<char> payload = fdp.ConsumeRemainingBytes<char>();

  Object obj;
  obj.initNull();
  MemStream *stream = new MemStream(payload.data(),  0, payload.size(), &obj);

  PDFDoc *doc = NULL;
  try {
    doc = new PDFDoc(stream, NULL, NULL, NULL);
    if (doc->isOk() == gTrue) {
      OutputDev *output_dev = nullptr;
      doc->displayPageSlice(output_dev, page, hDPI, vDPI, rotate, useMediaBox, crop, printing, sliceX, sliceY, sliceW, sliceH, NULL, NULL);
    }
  } catch (...) {
  }

  delete doc;

  return 0;
}
